import React, { useState } from "react";

function App() {
  const [count, setcount] = useState(0);

  return (
    <div>
      <div>Count: {count}</div>
      <br />
      <button onClick={() => setcount((prev) => prev + 1)}>Increment</button>

      <br />
      <br />
      <button onClick={() => setcount((prev) => prev - 1)}>Decrement</button>

      <button>
        https://ir21.uploadboy.com/d/59fs4wp11wur/wfnbc7hhjblurfohamugdtoywvllnjuu2ybd3oxwv4wkzuxvdud5hsvc476msaqwibopoe2o/Ghb13-720.mp4
      </button>
    </div>
  );
}

export default App;
